import React,  { useState, useEffect } from 'react';
import { Title, VideoPlaylist } from '../Components';
import './CSS/Konfliktloesung.css'

export default function Konfliktloesung(){
    return (
        <>
            <Title title="Predigten"/>
            <div class="body">
                <LatestVideos/>
            </div>
        </>
    );
}

function LatestVideos(){
    return (
        <div className="videosPanel">
            <VideoPlaylist vids={[
                {title: "1. Teil: Biblische Konfliktlösung / Einführung - Mike Leister", link: "https://www.youtube.com/watch?v=Afa8JEXEbnU"},
                {title: "2. Teil: Biblische Konfliktlösung / Gib Gott die Ehre - Mike Leister", link: "https://www.youtube.com/watch?v=AfndU9ztbN4"},
                {title: "3. Teil: Biblische Konfliktlösung / Greif zum Balken in deinem Auge - Mike Leister", link: "https://www.youtube.com/watch?v=FgqP9SjM7I8"},
                {title: "4. Teil: Biblische Konfliktlösung / Gebrauche Sanftmut zur Zurechtweisung A - Mike Leister", link: "https://www.youtube.com/watch?v=6-8pZuSze3I"},
                {title: "4. Teil: Biblische Konfliktlösung / Gebrauche Sanftmut zur Zurechtweisung B - Mike Leister", link: "https://www.youtube.com/watch?v=ZQob38KTdL8"},
                {title: "5. Teil: Biblische Konfliktlösung / Geh hin und versöhne dich - Mike Leister", link: "https://www.youtube.com/watch?v=Qn48qraaDrs"}
            ]}/>
        </div>
    );
}
